							<span>Shkarkojeni %3$s</span>
							<em>Madhësi: %4$s</em>
							</a>','Reset Hub Demo'=>'Demonstrim për Qendër Rikthimi Te Parazgjedhjet','Upgrade to Premium '=>'Përmirësojeni me versionin Me Pagesë ','Please note, the features displayed below are part of an image showcasing the potential of Reset Hub in its Premium version. To activate and enjoy these advanced features, <a href="https://servmask.com/products/unlimited-extension" title="Upgrade to Premium" target="_blank">upgrade to Premium now</a>! Elevate your website management experience with these exclusive functionalities and priority support.'=>'Ju lutemi, kini parasysh se, veçoritë e shfaqura më poshtë janë pjesë e një figure që shfaq potencialin për Qendër Rikthimi Te Parazgjedhjet në versionin e vet Me Pagesë. Për të aktivizuar dhe shijuar këto veçori të thelluara, <a href="https://servmask.com/products/unlimited-extension" title="Upgrade to Premium" target="_blank">përmirësojeni që tani me versionin Me Pagesë</a>! Shpjereni më lart administrimin e sajtit tuaj, me këto funksione ekskluzive dhe asistencë me përparësi.','Experience Full Functionality with Premium!'=>'Shijoni Funksionim të Plotë, me versionin Me Pagesë!','Star'=>'Yll','Reset Hub'=>'Qendër Rikthimi Te Parazgjedhjet','Premium'=>'Me Pagesë','Leverage the simplicity of Dropbox for your backup needs. Direct your scheduled backups to be stored in Dropbox. It\'s secure, straightforward, and keeps your backups at your fingertips.'=>'Shfrytëzoni thjeshtësinë e Dropbox-it për nevojat tuaja për kopjeruajtje. Drejtojini kopjeruajtjet tuaja të planifikuara të depozitohen në Dropbox. Është e siguruar, e drejtpërdrejtë dhe i mban kopjeruajtjet tuaja më majë të gishtave.','Tailor your backup schedules to fit the complexity of your WordPress Multisite. Choose to export the entire network or only a selection of subsites according to your requirements. Effortless management for even the most intricate site networks.'=>'Përshtatni planifikimin e kopjeruajtjeve tuaja, që të përkojnë me shkallën e ndërlikimit të instalimit tuaj WordPress Shumësajtësh. Zgjidhni të eksportoni krejt rrjetin, ose vetëm një përzgjedhje nënsajtesh në përputhje me kërkesat tuaja. Administrim pa mundim, madje dhe për rrjetet më të ndërlikuar sajtesh.','We\'ve got you covered with an array of supported storage providers. Whether you prefer Box, Amazon S3, WebDav or something else, you can choose the one that fits your needs best. Secure your backups exactly where you want them.'=>'Ju mbulojmë me një gamë furnizuesish depozitimi. Qoftë kur parapëlqeni Box, Amazon S3, WebDav, apo diçka tjetër, mund të zgjidhni një që plotëson më mirë nevojat tuaja. Siguroni kopjeruajtjet tuaja mu atje ku i doni.','Enjoy the flexibility of FTP storage. Direct your scheduled backups to your own FTP server. You\'ll have full control over your data, providing you with a versatile and private storage solution.'=>'Shfrytëzoni zhdërvjelltësinë e depozitës tuaj FTP. Drejtojini kopjeruajtjet tuaja të planifikuara për te shërbyesi juaj FTP. Do të keni kontroll të plotë mbi të dhënat tuaja, duke ju dhënë një zgjidhje të shumanshme dhe private për depozitimin.','Harness the power of OneDrive for your backups. Set up your scheduled backups to be saved directly in your OneDrive. It\'s secure, integrated with your Microsoft account, and keeps your data readily accessible.'=>'Shfrytëzoni për kopjeruajtjet fuqinë e OneDrive-it. Ujdisni kopjeruajtjet tuaja të planifikuara, që të ruhen drejt e te OneDrive-i juaj. Është e siguruar, e integruar me llogarinë tuaj Microsoft dhe i mban të dhënat tuaja gati për t’i përdorur.','Benefit from the robustness of Google Drive. Schedule your backups to be saved directly to your Google Drive account. Simple, secure, and integrated into a platform you already use.'=>'Përfitoni nga fortësia e Google Drive-it. Vini në plan kopjeruajtjet tuaja të ruhen drejtpërdrejt te llogaria juaj Google Drive. E thjeshtë, e siguruar dhe e integruar në një platformë që e përdorni tashmë.','Manage your storage effectively with our flexible retention settings. Decide how many backups you want to keep at a time. Old backups are automatically cleared, keeping your storage neat and efficient.'=>'Administroni me efikasitet depozitën tuaj, me rregullimet tona të zhdërvjellëta të mbajtjes. Vendosni se sa kopjeruajtje dëshironi të mbahen gjatë një kohe të caktuar. Kopjeruajtjet e vjetra spastrohen vetvetiu, duke e mbajtur depozitën tuaj të pastër dhe efikase.','Retention settings'=>'Rregullime mbajtjeje','Stay informed, not overwhelmed. Tailor your notification preferences to get updates that matter to you. Whether it\'s the status of each backup, or just critical alerts, control what you want to be notified about.'=>'Jini në dijeni, pa u përmbytur me informacion. Ujdisni parapëlqimet tuaja për njoftime, që të merrni përditësime që kanë vlerë për ju. Qoftë kur bëhet fjalë për gjendjen e secilës kopjeruajtje, se thjesht për sinjalizime kritike, kontrolloni se për çfarë doni të njoftoheni.','Notification settings'=>'Rregullime njoftimesh','Never worry about forgetting to back up your site again. Choose from various scheduling options, from daily to monthly, and we\'ll automate the rest. Backups happen like clockwork, giving you peace of mind and a solid safety net'=>'Mos u shqetësoni më se mos harroni të kopjeruani sajtin tuaj. Zgjidhni një prej mundësive të larmishme të planifikimit, nga të përditshme në të përmuajshme dhe ne do të automatizojmë pjesën e mbetur. Kopjeruajtjet kryhen si me sahat, duke ju lënë me mendje të fjetur dhe dhënë një rrjet solid sigurie','Enable this feature'=>'Aktivizoje këtë veçori','Backup scheduler'=>'Planifikues kopjeruajtjesh','Multisite Schedules'=>'Vënie Në Plan Në Instalime Shumësajtëshe','More Storage Providers'=>'Më Tepër Shërbime Depozitimi','FTP Storage'=>'Depozitim FTP','OneDrive Storage'=>'Depozitim OneDrive','Dropbox Storage'=>'Depozitim Dropbox','Google Drive Storage'=>'Depozitim Google Drive','Retention Settings'=>'Rregullime Mbajtjeje','Notification Set